import React from 'react';
import Login from '../components/Login'

const Home = () => {
    const [registerView, setRegister] = React.useState(null)
    return (
        <div>
        <h1>Welcome!</h1>
        <div>
            <Login registerView={registerView} setRegister={setRegister}/>
        </div>
        </div>
    );
};

export default Home;
